    <script>
      onload = function() {
        setInterval(() => {
         if ((_("percent").innerText * 1) < 8)
         {
           _("percent").innerText = (_("percent").innerText * 1) + 1;
           console.log("WindowsUpdate.Status.Up<Interval 800ms> := " + _("percent").innerText);
         }
        }, 800);
        setInterval(() => {
         if ((_("percent").innerText * 1) < 20)
         {
           _("percent").innerText = (_("percent").innerText * 1) + 1;
           console.log("WindowsUpdate.Status.Up<Interval 3500ms> := " + _("percent").innerText);
         }
        }, 3500);
        setInterval(() => {
         if ((_("percent").innerText * 1) < 80)
         {
           _("percent").innerText = (_("percent").innerText * 1) + 1;
           console.log("WindowsUpdate.Status.Up<Interval 6500ms> := " + _("percent").innerText);
         }
        }, 6500);
        setInterval(() => {
         _("percent").innerText = (_("percent").innerText * 1) + 1;
         console.log("WindowsUpdate.Status.Up<Interval 12500ms> := " + _("percent").innerText);
         if ((_("percent").innerText * 1) == 100)
         {
           _("update").style = "display:none;";
           _("update2").style = "display:block;";
         }
         if ((_("percent").innerText * 1) == 101)
         {
           _("home").style = "display:none;";
           _("winlogin").style.display = "block";
         }
        }, 12500);
        const currentDate = new Date();
        const month = currentDate.getMonth() + 1;
        const date = currentDate.getDate();
        const dayNum = currentDate.getDay();
        const weekday = ["日","月","火","水","木","金","土"];
        const day = weekday[dayNum];
        const outputDateEl = document.querySelector('.output-date');
        _("day").innerHTML = "<h1>" + month + "月" + date + "日("+day+")</h1>";
        setInterval(() => {
          var e=new Date;
          _("time").innerHTML = "<h1>"+e.getHours()+":"+e.getMinutes()+"</h1>"
        }, 1000);
      }
    </script>
